# Vysokaya, Republic of Bashkortostan

}}
Vysokaya () is a rural locality (a village) in Ulu-Telyaksky Selsoviet, Iglinsky District, Bashkortostan, Russia. The population was 9 as of 2010. There is 1 street.
Geography
Vysokaya is located 27 km east of Iglino (the district's administrative centre) by road.
